import React from 'react'
import PropTypes from 'prop-types'


const Form = () => {
  return (
    <form>
        <h3>Message me!</h3>
        Email:<input type="text" placeholder="Enter your email here"></input>
        Message:<input type="text" placeholder="Enter your message here"></input>
        <button>Submit</button>
    </form>
  )
}
export default Form;
